class Track{constructor(code,rjCode,cvs,tags,series,engName,japName,thumbnail,images,audios,otherLink){Object.assign(this,{code:code,rjCode:rjCode,cvs:cvs,tags:tags,series:series,engName:engName,japName:japName,thumbnail:thumbnail,images:images,audios:audios,otherLink:otherLink})}}class Category{constructor(name,quantity){Object.assign(this,{name:name,quantity:quantity})}}class Cv extends Category{constructor(name,quantity){super(name,quantity)}}class Tag extends Category{constructor(name,quantity){super(name,quantity)}}class Series extends Category{constructor(name,quantity){super(name,quantity)}}class SearchResult{constructor(type,value,keyword,code){Object.assign(this,{type:type,value:value,keyword:keyword,code:code}),this.displayType=Utils.convertToTitleCase(this.type)}}class OtherLink{constructor(note,url){Object.assign(this,{note:note,url:url})}}